            <div className="h-16 w-16 bg-purple-500 rounded-full mb-4 flex items-center justify-center text-white">
              <div className="h-8 w-8">ðŸ”µ</div> {/* Replace with appropriate icon or symbol */}
            </div>
            <p className="text-gray-600 text-center">
              <strong>Ovulation Day:</strong> {ovulationDay}
