              <div className="h-8 w-8">ðŸŸ¢</div> {/* Replace with appropriate icon or symbol */}
            </div>
            <p className="text-gray-600 text-center">
              <strong>Fertile Window:</strong> {fertileWindowStart} - {fertileWindowEnd}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PeriodPredictions;
